import Link from 'react-route-dom';
import './index.scs'

const Home = () => {
    return (
        <div className="container home-page">
            <div className="text-zone">
                <h1>As Salam Aleykoum, <br /> I'm
                    Ayman
                </h1>
                <h2>I make ressources for muslims to help them learn the Quran</h2>
                <Link to="/contact" className='flat-button'>CONTACT ME!</Link>
            </div>

        </div>
    )
}

export default Home
